    return(
    <div className="demo">
        <div style={{ width: buttonWidth, marginLeft: buttonWidth * 4 + 24 }}>
        <Popover placement="right" title={text} content={content} trigger="click">
            <a>Right</a>
        </Popover>
        </div>
    </div>
    );
}

